class FakeFile(object):

    " A class to convert a string into a file-like object"

    def __init__(self, d=""):
        self.s = d.split('\n')

    def __iter__(self):
        return iter(self.s)

    def write(self, s):
        self.s += s

    def close(self):
        pass

    def seek(self, seek_position):
        pass


